USE formulario;

create table PID_TIPO_DOCUMENTO
(
    TIPO_DOCUMENTO_ID                   int auto_increment
        primary key,
    TIPO_DOCUMENTO_CODIGO               varchar(10)                            not null,
    TIPO_DOCUMENTO_DESCRIPCION          varchar(300) default 'SIN DESCRIPCIÓN' null,
    TIPO_DOCUMENTO_ESTADO               char(2)      default '01'              not null comment '01: Activo, 02: Inactivo',
    TIPO_DOCUMENTO_USUARIO_CREACION     int                                    null,
    TIPO_DOCUMENTO_FECHA_CREACION       datetime     default CURRENT_TIMESTAMP null,
    TIPO_DOCUMENTO_USUARIO_MODIFICACION int                                    null,
    TIPO_DOCUMENTO_FECHA_MODIFICACION   datetime     default CURRENT_TIMESTAMP null on update CURRENT_TIMESTAMP,
    constraint PID_TIPO_DOCUMENTO_UK_1
        unique (TIPO_DOCUMENTO_CODIGO)
);

create table PID_PERSONA
(
    PERSONA_ID                   int auto_increment
        primary key,
    PERSONA_TIPO_DOCUMENTO_ID    int                                    not null,
    PERSONA_TIPO_DOCUMENTO_VALOR varchar(20)                            not null,
    PERSONA_NOMBRES              varchar(300) default 'SIN NOMBRE'      not null,
    PERSONA_APELLIDOS            varchar(300) default 'SIN APELLIDO'    not null,
    PERSONA_GENERO               char(2)      default '01'              not null comment '01: Masculino, 02: Femenino',
    PERSONA_DIRECCION            varchar(300)                           null,
    PERSONA_FECHA_NACIMIENTO     date                                   null,
    PERSONA_ESTADO               char(2)      default '01'              not null comment '01: Activo, 02: Inactivo',
    PERSONA_USUARIO_CREACION     int                                    null,
    PERSONA_FECHA_CREACION       datetime     default CURRENT_TIMESTAMP null,
    PERSONA_USUARIO_MODIFICACION int                                    null,
    PERSONA_FECHA_MODIFICACION   datetime     default CURRENT_TIMESTAMP null on update CURRENT_TIMESTAMP,
    constraint PID_PERSONA_UK_1
        unique (PERSONA_TIPO_DOCUMENTO_VALOR),
    constraint PID_PERSONA_FK_1
        foreign key (PERSONA_TIPO_DOCUMENTO_ID) references PID_TIPO_DOCUMENTO (TIPO_DOCUMENTO_ID)
);



create table PID_CORREO
(
    CORREO_ID                   int auto_increment
        primary key,
    CORREO_PERSONA_ID           int                                not null,
    CORREO_DESCRIPCION          varchar(300)                       not null,
    CORREO_ESTADO               char(2)  default '01'              not null comment '01: Activo, 02: Inactivo',
    CORREO_USUARIO_CREACION     int                                null,
    CORREO_FECHA_CREACION       datetime default CURRENT_TIMESTAMP null,
    CORREO_USUARIO_MODIFICACION int                                null,
    CORREO_FECHA_MODIFICACION   datetime default CURRENT_TIMESTAMP null on update CURRENT_TIMESTAMP,
    constraint PID_CORREO_UK_2
        unique (CORREO_DESCRIPCION),
    constraint PID_CORREO_FK_1
        foreign key (CORREO_PERSONA_ID) references PID_PERSONA (PERSONA_ID)
);

create table PID_DIRECTOR
(
    DIRECTOR_ID                   int auto_increment
        primary key,
    DIRECTOR_PERSONA_ID           int                                not null,
    DIRECTOR_USUARIO_CREACION     int                                null,
    DIRECTOR_FECHA_CREACION       datetime default CURRENT_TIMESTAMP null,
    DIRECTOR_USUARIO_MODIFICACION int                                null,
    DIRECTOR_FECHA_MODIFICACION   datetime default CURRENT_TIMESTAMP null on update CURRENT_TIMESTAMP,
    constraint PID_DIRECTOR_FK_1
        foreign key (DIRECTOR_PERSONA_ID) references PID_PERSONA (PERSONA_ID)
);

create table PID_INSTITUCION_EDUCATIVA
(
    INSTITUCION_EDUCATIVA_ID                   int auto_increment
        primary key,
    INSTITUCION_EDUCATIVA_UGEL_ID              int                                    null,
    INSTITUCION_EDUCATIVA_DIRECTOR_ID          int                                    null,
    INSTITUCION_EDUCATIVA_CODIGO_MODULAR       varchar(10)                            not null,
    INSTITUCION_EDUCATIVA_NOMBRE               varchar(300) default 'SIN DESCRIPCIÓN' null,
    INSTITUCION_EDUCATIVA_TIPO                 varchar(20)  default 'NO APLICA'       not null,
    INSTITUCION_EDUCATIVA_ESTADO               char(2)      default '01'              not null comment '01: Activo, 02: Inactivo',
    INSTITUCION_EDUCATIVA_USUARIO_CREACION     int                                    null,
    INSTITUCION_EDUCATIVA_FECHA_CREACION       datetime     default CURRENT_TIMESTAMP null,
    INSTITUCION_EDUCATIVA_USUARIO_MODIFICACION int                                    null,
    INSTITUCION_EDUCATIVA_FECHA_MODIFICACION   datetime     default CURRENT_TIMESTAMP null on update CURRENT_TIMESTAMP,
    constraint PID_INSTITUCION_EDUCATIVA_UK_1
        unique (INSTITUCION_EDUCATIVA_CODIGO_MODULAR),
    constraint PID_INSTITUCION_EDUCATIVA_FK_2
        foreign key (INSTITUCION_EDUCATIVA_DIRECTOR_ID) references PID_DIRECTOR (DIRECTOR_ID)
);

create table PID_NOVEL
(
    NOVEL_ID                       int auto_increment
        primary key,
    NOVEL_PERSONA_ID               int                                not null,
    NOVEL_GRUPO_INSCRIPCION_ID     int                                null,
    NOVEL_INSTITUCION_EDUCATIVA_ID int                                null,
    NOVEL_USUARIO_CREACION         int                                null,
    NOVEL_FECHA_CREACION           datetime default CURRENT_TIMESTAMP null,
    NOVEL_USUARIO_MODIFICACION     int                                null,
    NOVEL_FECHA_MODIFICACION       datetime default CURRENT_TIMESTAMP null on update CURRENT_TIMESTAMP,
    constraint PID_NOVEL_FK_1
        foreign key (NOVEL_PERSONA_ID) references PID_PERSONA (PERSONA_ID),
    constraint PID_NOVEL_FK_3
        foreign key (NOVEL_INSTITUCION_EDUCATIVA_ID) references PID_INSTITUCION_EDUCATIVA (INSTITUCION_EDUCATIVA_ID)
);



create table PID_TELEFONO
(
    TELEFONO_ID                   int auto_increment
        primary key,
    TELEFONO_PERSONA_ID           int                                not null,
    TELEFONO_DESCRIPCION          char(9)                            not null,
    TELEFONO_ESTADO               char(2)  default '01'              not null comment '01: Activo, 02: Inactivo',
    TELEFONO_USUARIO_CREACION     int                                null,
    TELEFONO_FECHA_CREACION       datetime default CURRENT_TIMESTAMP null,
    TELEFONO_USUARIO_MODIFICACION int                                null,
    TELEFONO_FECHA_MODIFICACION   datetime default CURRENT_TIMESTAMP null on update CURRENT_TIMESTAMP,
    constraint PID_TELEFONO_UK_1
        unique (TELEFONO_DESCRIPCION),
    constraint PID_TELEFONO_FK_1
        foreign key (TELEFONO_PERSONA_ID) references PID_PERSONA (PERSONA_ID)
);



